window.bookSummaryJSON = "<p><i>The $20 Note</i> follows an ordinary bank note on an extraordinary journey through the streets of New York and beyond, from the borough of Queens to the heavens above.&nbsp;&nbsp;</p> <p>We follow the note as it travels from one person to the next, unbeknownst to them, as they go about their daily lives, those of which vary wildly between normality and causality.</p> <p>So please fasten your seat belts and follow me on a trip into the unknown as we set off on one hell of an adventure! You never know where it may lead!</p>"; 
